import React from 'react';
import { Nav, Navbar } from 'react-bootstrap';
import 'components/Navigation/Navigation.css';

const navigation = () => (
    <Navbar className="navigationBar" expand="lg" fixed="top">
        <Nav>
            <Nav.Item className="nav-item"><Nav.Link href="/">Home</Nav.Link></Nav.Item>
            <Nav.Item className="nav-item"><Nav.Link href="/">About</Nav.Link></Nav.Item>
            <Nav.Item className="nav-item"><Nav.Link href="/">Contact</Nav.Link></Nav.Item>
        </Nav>
        <Navbar.Brand className="navbar-brand" href="#">
        re-set
    </Navbar.Brand>
    </Navbar>
);

export default navigation;
